import { Container, Button } from 'reactstrap';


import HomePageCarousel from '../components/HomePageCarousel';

function Home() {
    return(
        <Container>
            <div>
                <Button color="primary">Primary</Button>
                <HomePageCarousel />                
            </div>
        </Container>
    );
}

export default Home;
